  TweenMax.from('.wrp-ima-send img', .8, { delay: 2.5, y: 10, opacity: 0, ease: Power0.easeInOut })

 }, []);

 return (
  <div className='wrp-img-valide'>
   <img src={props.IMA} alt={'money'} />
   <p className='unite-prix-currency'>Franc congolais</p>
  </div>
 );
}
